import "./landing.scss";
import photo from "../../img/photo.jpg";
import bubble from "../../img/bubble.svg";

export default function Landing() {
  return (
    <div className="landing">
      <img alt="photo" src={photo} className={`img-fade-in photo`}></img>
      <img alt="bubble" src={bubble} className={`bubble-fade-in bubble`}></img>
      <h1 className={`h1-fade-in`}>Hello.</h1>
      <div className={`text-fade-in span-wrapper`}>
        <span>Web Developer</span>
        <span>Software Developer</span>
        <span>IT Generalist</span>
        <span>Security Enthusiast</span>
      </div>
    </div>
  );
}
